import React from "react";

export default function NavTemplate(props) {
  const { text, onClick, isRoulette } = props;

  const handleclick = () => {
    onClick();
  };

  return (
    <div
      onClick={handleclick}
      className={
        isRoulette === true
          ? "navigation-text-wrap-done"
          : "navigation-text-wrap"
      }
      name
    >
      <div className="navigation-text">{text}</div>
    </div>
  );
}
